function selectUser(n){let t={id:n};$.ajax({url:"/SelectUser",type:"POST",dataType:"html",data:t,success:function(n){$("#edit-container").html(n);$("#edit-user-modal").modal("show")},error:function(){}})}function banUser(n){let t={id:n};$.ajax({url:"/Ban",type:"POST",dataType:"html",data:t,success:function(){searchUser()},error:function(){}})}function unbanUser(n){let t={id:n};$.ajax({url:"/Unban",type:"POST",dataType:"html",data:t,success:function(){searchUser()},error:function(){}})}